import React from "react";

const title = () => {
    return (
        <section className="scroll-section">
            <div className="menu-content">
                <div className="title">
                    <span className="name">Kim Tae Woo</span>
                    <span className="portfolio">Develop Portfolio</span>
                </div>
                <div className="subtitle">
                    <h1>
                        <span className="highlight-game">Game</span> Developer
                    </h1>
                </div>
            </div>
        </section>
    );
};

export default title;
